function st_display(index)
{
    let searchItem=cardata.features[index].properties.SurfaceType
    return searchItem
}

function cn_display(index)
{
    let searchItem=cardata.features[index].properties.Campaign
    return searchItem
}

function dt_display(index)
{
    let searchItem=cardata.features[index].properties.Date
    let year=searchItem.slice(0,4)
    let month=searchItem.slice(4,6)
    let day=searchItem.slice(6,8)
    searchItem=year+'/'+month+'/'+day
    return searchItem
}

function del()
{
    $("#Vdata tbody tr").remove()
}

function arraySearch(funcInput, val)
{
    let dataTemplate=``
    let len=cardata.features.length

    for(let i=0;i<len;i++)
    {
        if(funcInput(i)===val)
        {
            dataTemplate=
            `
                <tr>
                    <td>${sc_display(i)}</td>
                    <td>${st_display(i)}</td>
                    <td>${cn_display(i)}</td>
                    <td>${dt_display(i)}</td>
                </tr>
            `

            table.innerHTML+=dataTemplate
        }
    }
}

//For dropdown menu

//SkyCondition dropdown
let skcon=document.getElementById("sky")

skcon.addEventListener
("change", (e) => {
    const value = e.target.value

    document.getElementById("sur").selectedIndex = 0
    document.getElementById("camp").selectedIndex = 0
    document.getElementById("textbox").value = ""
   
    if (value) 
    {

        if(value==="clear")
        {
            del()

            arraySearch(sc_display, "clear")
        }

        else if(value==="cloudy")
        {
            del()

            arraySearch(sc_display, "cloudy")
        }

    }
    else 
    {
        console.log("Value not found")
    }
  }
)

