//For textbox with Submit button function
function mainDisplay()
{
    del()

    document.getElementById("sky").selectedIndex = 0
    document.getElementById("sur").selectedIndex = 0
    document.getElementById("camp").selectedIndex = 0

    const val = document.getElementById("textbox").value;
    
    if(val>=0 && val<=1825)
    {

        let template=
        `
            <tr>
                <td>${sc_display(val)}</td>
                <td>${st_display(val)}</td>
                <td>${cn_display(val)}</td>
                <td>${dt_display(val)}</td>
            </tr>
        `

        table.innerHTML+=template
    }

    else
    {
        alert("Array Index OutOfBounds")
        let template=
        `
            <tr>
                <td>N/A</td>
                <td>N/A</td>
                <td>N/A</td>
                <td>N/A</td>
            </tr>
        `

        table.innerHTML+=template
    }
}